def createnamehash(PATH):
    conn = sqlite3.connect(PATH)
    cursor = conn.cursor()
    sql = "SELECT title,hash FROM Charts"
    cursor.execute(sql)
    hold = cursor.fetchall()
    answer = {}
    for i in hold:
        answer.update({i[0]:i[1]})
